import React from "react";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

function ToDoItem(props) {
  return (
    <div
      onClick={() => {
        props.onChecked(props.id);
      }}
    >
     
     <li><span>
<FontAwesomeIcon icon="fa-solid fa-trash" />
 {props.text}
</span>
</li>

    
    </div>
  );
}

export default ToDoItem;
